import './App.css';
import profileImg from './img/myself.jpg'
import logo from './img/logo.png'

function App() {
  return (
    <div className='App'>
      <img src = {logo} id='logo'></img>

      <h2> Creator: 大聪明</h2>
      <p> ⬇️</p>
      <img src = {profileImg} id='profile'></img>
    </div>

  );
}

export default App;
